<script>
var perVolumeList = []; // folder names per volume
var volumeFolder = "";

function perVolumeAclick()
{
	var id = $(this).attr('title');
	var uri = "http://kb-images.kb.dk/public/tekstportal/trykkefrihed/"
		+ volumeFolder + '/' + id
		+ "/full/1000,/0/default.jpg";
	$('#img').html('<div>' + id + '</div><div id="imgInner"><img src="' + uri + '" title="' + id + '" height="650"></div>');
	$('#img img').click(function() {
		if ($(this).attr('height')=='')
			$(this).attr('height','650'); // zoom out
		else
			$(this).attr('height',''); // zoom in
	});
}

$(function() {
	$('#volumes a').click(function(){
		var id = $(this).text();
		var volTitle = '<p>' + id.replace(/(\d+)-(\d+)/, 'RÃ¦kke $1, bind $2') + '</p>';

		volumeFolder = imgs[id][0];
		var html = "";
		// loop though all image file names and show in perVolume pane
		var lines = imgs[id][1].map(x => '<a title="' +x+ '">' + x.replace(/^\d+_/,'') + '</a>');
		$('#perVolume').html( volTitle + lines.join(' ') );
		$('#perVolume a').click(perVolumeAclick);
	});
});
